package algorithms.num370_RangeAddition;

import java.util.HashMap;
import java.util.Iterator;
import java.util.Map;

public class Solution20160816Tue2256 {
    public int[] getModifiedArray(int length, int[][] updates) {
        int[] arr = new int[length];
        Map<int[], Integer> map = new HashMap<int[], Integer>();
        for (int i = 0; i < updates.length; i++) {
        	int[] borders = new int[2];
        	borders[0] = updates[i][0];
        	borders[1] = updates[i][1];
        	if (map.containsKey(borders)) map.put(borders, map.get(borders) + updates[i][2]);
        	else map.put(borders, updates[i][2]);
        }
        Iterator<int[]> it = map.keySet().iterator();
        while (it.hasNext()) {
            int[] borders = it.next();
            update(arr, borders, map.get(borders));
        }
        return arr;
    }
    
    private static void update(int[] arr, int[] borders, int value) {
    	for (int i = borders[0]; i <= borders[1]; i++) arr[i] += value;
    }
}
